import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { Box, Container } from '@mui/material';
import { useAuth } from '../contexts/AuthContext';

// Layout
import Navigation from './Layout/Navigation';
import Footer from './Layout/Footer';

// Public Pages
import Home from './Pages/Home';
import AboutUs from './Pages/AboutUs';
import ContactUs from './Pages/ContactUs';
import Login from './Auth/Login';
import Register from './Auth/Register';
import RegisterOrganization from './Auth/RegisterOrganization';

// Protected Pages
import Dashboard from './Dashboard/Dashboard';
import Profile from './Profile/Profile';
import CasesList from './Cases/CasesList';
import CaseForm from './Cases/CaseForm';
import CaseDetail from './Cases/CaseDetail';
import ReportsList from './Reports/ReportsList';
import ReportForm from './Reports/ReportForm';
import VictimsList from './Victims/VictimsList';
import VictimForm from './Victims/VictimForm';
import Analytics from './Analytics/Analytics';

// Admin Pages
import AdminDashboard from './Admin/AdminDashboard';
import UserManagement from './Admin/UserManagement';
import OrganizationManagement from './Admin/OrganizationManagement';
import ContactMessages from './Admin/ContactMessages';

// Organization Pages
import OrganizationDashboard from './Organization/OrganizationDashboard';
import OrganizationProfile from './Organization/OrganizationProfile';
import AssignedCases from './Organization/AssignedCases';

// Protected Route Component
const ProtectedRoute = ({ children, allowedRoles = [] }) => {
  const { user, loading } = useAuth();

  // Show loading state if auth is still being checked
  if (loading) {
    return <div>Loading...</div>;
  }

  // If not logged in, redirect to login
  if (!user) {
    return <Navigate to="/login" replace />;
  }

  // If roles are specified and user doesn't have permission, redirect to dashboard
  if (allowedRoles.length > 0 && !allowedRoles.includes(user.role)) {
    return <Navigate to="/dashboard" replace />;
  }

  // Otherwise, render the protected component
  return children;
};

const AppRoutes = () => {
  return (
    <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
      <Navigation />
      <Container component="main" sx={{ flexGrow: 1, py: 4 }}>
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<AboutUs />} />
          <Route path="/contact" element={<ContactUs />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/register-organization" element={<RegisterOrganization />} />

          {/* Protected Routes for all authenticated users */}
          <Route path="/dashboard" element={
            <ProtectedRoute>
              <Dashboard />
            </ProtectedRoute>
          } />
          <Route path="/profile" element={
            <ProtectedRoute>
              <Profile />
            </ProtectedRoute>
          } />
          <Route path="/cases" element={
            <ProtectedRoute>
              <CasesList />
            </ProtectedRoute>
          } />
          <Route path="/cases/new" element={
            <ProtectedRoute>
              <CaseForm />
            </ProtectedRoute>
          } />
          <Route path="/cases/:id" element={
            <ProtectedRoute>
              <CaseDetail />
            </ProtectedRoute>
          } />
          <Route path="/cases/:id/edit" element={
            <ProtectedRoute>
              <CaseForm />
            </ProtectedRoute>
          } />

          {/* Admin Routes */}
          <Route path="/admin" element={
            <ProtectedRoute allowedRoles={['admin']}>
              <AdminDashboard />
            </ProtectedRoute>
          } />
          <Route path="/admin/users" element={
            <ProtectedRoute allowedRoles={['admin']}>
              <UserManagement />
            </ProtectedRoute>
          } />
          <Route path="/admin/organizations" element={
            <ProtectedRoute allowedRoles={['admin']}>
              <OrganizationManagement />
            </ProtectedRoute>
          } />
          <Route path="/admin/contact-messages" element={
            <ProtectedRoute allowedRoles={['admin']}>
              <ContactMessages />
            </ProtectedRoute>
          } />
          <Route path="/admin/analytics" element={
            <ProtectedRoute allowedRoles={['admin']}>
              <Analytics />
            </ProtectedRoute>
          } />

          {/* Organization Routes */}
          <Route path="/organization" element={
            <ProtectedRoute allowedRoles={['organization']}>
              <OrganizationDashboard />
            </ProtectedRoute>
          } />
          <Route path="/organization/profile" element={
            <ProtectedRoute allowedRoles={['organization']}>
              <OrganizationProfile />
            </ProtectedRoute>
          } />
          <Route path="/organization/cases" element={
            <ProtectedRoute allowedRoles={['organization']}>
              <AssignedCases />
            </ProtectedRoute>
          } />

          {/* Reports Routes - Available to all authenticated users */}
          <Route path="/reports" element={
            <ProtectedRoute>
              <ReportsList />
            </ProtectedRoute>
          } />
          <Route path="/reports/new" element={
            <ProtectedRoute>
              <ReportForm />
            </ProtectedRoute>
          } />

          {/* Victims Routes - Available to admin and organization users */}
          <Route path="/victims" element={
            <ProtectedRoute allowedRoles={['admin', 'organization']}>
              <VictimsList />
            </ProtectedRoute>
          } />
          <Route path="/victims/new" element={
            <ProtectedRoute allowedRoles={['admin', 'organization']}>
              <VictimForm />
            </ProtectedRoute>
          } />

          {/* Catch-all route - redirect to home */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </Container>
      <Footer />
    </Box>
  );
};

export default AppRoutes;
